function getUserById(n){var t;return $.ajax({type:"GET","async":!1,url:"https://localhost:7128/api/User/".concat(n),contentType:"application/json; charset=utf-8",dataType:"json",error:function(n,t,i){console.log("Request: "+n.toString()+"\n\nStatus: "+t+"\n\nError: "+i)},success:function(n){t=JSON.parse(JSON.stringify(n))}}),t}function generateUserPersonalCabinetInfo(n){var t=getUserById(n);document.getElementById("FirstName").textContent=t.firstName;document.getElementById("MiddleName").textContent=t.middleName;document.getElementById("LastName").textContent=t.lastName;document.getElementById("UserName").textContent=t.userName;document.getElementById("Email").textContent=t.email;document.getElementById("PhoneNumber").textContent=t.phoneNumber}